  <script>
    (function(){
      var video = document.getElementById('video');
      var btn = document.getElementById('packshot-button');
      var logo = document.getElementById('logo');
      var tap = document.getElementById('tap-layer');
      var packshot = document.getElementById('packshot');

      var FPS = 24;
      var segments = [
        {start: 0.0, end: 2 + 5/24, loop: true},
        {start: 2 + 5/24, end: 6 + 12/24, loop: false},
        {start: 6 + 12/24, end: 8 + 19/24, loop: true},
        {start: 8 + 19/24, end: 11 + 23/24, loop: false},
        {start: 11 + 23/24, end: 13 + 22/24, loop: true}
      ];

      var stage = 0; // 1..5
      var started = false;
      var soundUnlocked = false;
      var allowExit = false;
      var ticking = false;

      function showBtn(show){ if (show) btn.classList.add('visible'); else btn.classList.remove('visible'); }

      function unlockSound(){
        if (soundUnlocked) return;
        soundUnlocked = true;
        video.muted = false;
        video.volume = 1.0;
      }

      function safePlay(){
        try {
          var p = video.play();
          if (p && p.catch) p.catch(function(){});
        } catch(e) {}
      }

      function gotoSegment(idx){
        stage = idx + 1;
        allowExit = !segments[idx].loop;
        var s = segments[idx].start;
        if (Math.abs(video.currentTime - s) > 0.05) {
          video.currentTime = s;
        }
        showBtn(segments[idx].loop);
        safePlay();
      }

      function nextSegment(){
        var nextIdx = stage; // stage is 1-based
        if (nextIdx >= segments.length) return;
        gotoSegment(nextIdx);
      }

      function handleLoop(seg){
        var t = video.currentTime;
        var end = seg.end;
        var start = seg.start;
        var eps = 1 / FPS;
        if (t >= end - eps) {
          if (allowExit) {
            nextSegment();
          } else {
            video.currentTime = start + (1 / FPS) * 0.25;
          }
        }
      }

      function tick(){
        if (!ticking) return;
        var idx = stage - 1;
        if (idx >= 0) {
          var seg = segments[idx];
          handleLoop(seg);
        }
        if (typeof video.requestVideoFrameCallback === 'function') {
          video.requestVideoFrameCallback(tick);
        } else {
          setTimeout(tick, 33);
        }
      }

        var onReady = function(){
          gotoSegment(0);
          ticking = true;
          if (typeof video.requestVideoFrameCallback === 'function') {
            video.requestVideoFrameCallback(tick);
          } else {
            setTimeout(tick, 33);
          }
        };

        if (video.readyState >= 3) onReady();
        else video.addEventListener('canplay', onReady, {once:true});
      }

      function handleTap(){
        unlockSound();
        safePlay();

        if (stage === 1) {
          allowExit = true; showBtn(false); return;
        }
        if (stage === 3) {
          allowExit = true; showBtn(false); return;
        }
        if (stage === 5) {
          packshot.classList.add('visible');
          CTA.onClick();
        }
      }

      tap.addEventListener('click', handleTap);
      logo.addEventListener('click', function(){ CTA.onClick(); });
      video.addEventListener('ended', function(){
        var idx = stage - 1;
        if (idx < 0) return;
        var seg = segments[idx];
        if (!seg.loop) return;
        video.currentTime = seg.start + (1 / FPS) * 0.25;
        safePlay();
      });

      if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', start);
      } else {
        start();
      }
    })();
